import React from 'react'
import styled from "styled-components";

import { COLOR, BORDER, FONT, SPACING } from "../constants";

const StyledCard = styled.article`

width: 300px;
`


function Card({quote}) {
    return (
        <StyledCard>
            <img src={quote.image} />
            <p>{quote.quote}</p>
        </StyledCard>
    )
}

export default Card
